import React, { Component } from "react";
import { Grid, Cell } from "react-mdl";
class HiChames extends Component {
  render() {
    return (
      <div style={{ width: "100%", margin: "auto" }}>
        <Grid className="Landing-Grid">
          <Cell col={12} />
        </Grid>
      </div>
    );
  }
}

export default HiChames;
